import './App.css';
import Container from './components/Container.js'
import Topics from './components/Api/google-trend.js'

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      greeting: ''
    };

  }

 componentDidMount(){


     const res = Topics()
     const c = Promise.resolve(res)
    console.log(res)
 }

  render() {
    return (
      <div className="App">
        <Container />
      </div>
    );
  }
}

export default App;
